PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE `core_store` (`id` integer not null primary key autoincrement, `key` varchar(255) null, `value` text null, `type` varchar(255) null, `environment` varchar(255) null, `tag` varchar(255) null);
CREATE TABLE `strapi_webhooks` (`id` integer not null primary key autoincrement, `name` varchar(255) null, `url` text null, `headers` text null, `events` text null, `enabled` boolean null);
CREATE TABLE `strapi_permission` (`id` integer not null primary key autoincrement, `action` varchar(255) not null, `subject` varchar(255) null, `fields` text null, `conditions` text null, `role` integer null, `created_at` datetime null default CURRENT_TIMESTAMP, `updated_at` datetime null default CURRENT_TIMESTAMP);
CREATE TABLE `strapi_role` (`id` integer not null primary key autoincrement, `name` varchar(255) not null, `code` varchar(255) not null, `description` varchar(255) null, `created_at` datetime null default CURRENT_TIMESTAMP, `updated_at` datetime null default CURRENT_TIMESTAMP);
CREATE TABLE `strapi_administrator` (`id` integer not null primary key autoincrement, `firstname` varchar(255) null, `lastname` varchar(255) null, `username` varchar(255) null, `email` varchar(255) not null, `password` varchar(255) null, `resetPasswordToken` varchar(255) null, `registrationToken` varchar(255) null, `isActive` boolean null, `blocked` boolean null);
CREATE TABLE `strapi_users_roles` (`id` integer not null primary key autoincrement, `user_id` integer null, `role_id` integer null);
CREATE TABLE `upload_file` (`id` integer not null primary key autoincrement, `name` varchar(255) not null, `alternativeText` varchar(255) null, `caption` varchar(255) null, `width` integer null, `height` integer null, `formats` text null, `hash` varchar(255) not null, `ext` varchar(255) null, `mime` varchar(255) not null, `size` float not null, `url` varchar(255) not null, `previewUrl` varchar(255) null, `provider` varchar(255) not null, `provider_metadata` text null, `created_by` integer null, `updated_by` integer null, `created_at` datetime null default CURRENT_TIMESTAMP, `updated_at` datetime null default CURRENT_TIMESTAMP);
CREATE TABLE `upload_file_morph` (`id` integer not null primary key autoincrement, `upload_file_id` integer null, `related_id` integer null, `related_type` text null, `field` text null, `order` integer null);
CREATE TABLE `users-permissions_permission` (`id` integer not null primary key autoincrement, `type` varchar(255) not null, `controller` varchar(255) not null, `action` varchar(255) not null, `enabled` boolean not null, `policy` varchar(255) null, `role` integer null, `created_by` integer null, `updated_by` integer null);
CREATE TABLE `users-permissions_role` (`id` integer not null primary key autoincrement, `name` varchar(255) not null, `description` varchar(255) null, `type` varchar(255) null, `created_by` integer null, `updated_by` integer null);
CREATE TABLE `posts_components` (`id` integer not null primary key autoincrement, `field` varchar(255) not null, `order` integer not null, `component_type` varchar(255) not null, `component_id` integer not null, `post_id` integer not null, constraint `post_id_fk` foreign key(`post_id`) references "tmp_posts"(`id`) on delete CASCADE);
CREATE TABLE `tokens` (`id` integer not null primary key autoincrement, `name` varchar(255) null, `token` varchar(255) null, `user` integer null, `created_by` integer null, `updated_by` integer null, `created_at` datetime null default CURRENT_TIMESTAMP, `updated_at` datetime null default CURRENT_TIMESTAMP);
CREATE TABLE `article` (`id` integer not null primary key autoincrement, `title` varchar(255), `lead` text null, `content` text null, `author` integer null, `slug` varchar(255), `published_at` datetime null, `created_by` integer null, `updated_by` integer null, `created_at` datetime null default CURRENT_TIMESTAMP, `updated_at` datetime null default CURRENT_TIMESTAMP);
CREATE TABLE `article_components` (`id` integer not null primary key autoincrement, `field` varchar(255) not null, `order` integer not null, `component_type` varchar(255) not null, `component_id` integer not null, `article_id` integer not null, constraint `article_id_fk` foreign key(`article_id`) references `article`(`id`) on delete CASCADE);
CREATE TABLE `post` (`id` integer not null primary key autoincrement, `title` varchar(255), `lead` text null, `content` text null, `author` integer null, `slug` varchar(255), `published_at` datetime null, `created_by` integer null, `updated_by` integer null, `created_at` datetime null default CURRENT_TIMESTAMP, `updated_at` datetime null default CURRENT_TIMESTAMP);
CREATE TABLE `post_components` (`id` integer not null primary key autoincrement, `field` varchar(255) not null, `order` integer not null, `component_type` varchar(255) not null, `component_id` integer not null, `post_id` integer not null, constraint `post_id_fk` foreign key(`post_id`) references `post`(`id`) on delete CASCADE);
CREATE TABLE `users-permissions_user` (`id` integer not null primary key autoincrement, `username` varchar(255) not null, `email` varchar(255) not null, `provider` varchar(255) null, `password` varchar(255) null, `resetPasswordToken` varchar(255) null, `confirmed` boolean null, `blocked` boolean null, `role` integer null, `created_by` integer null, `updated_by` integer null, `created_at` datetime null default CURRENT_TIMESTAMP, `updated_at` datetime null default CURRENT_TIMESTAMP);
CREATE TABLE `articles_components` (`id` integer not null primary key autoincrement, `field` varchar(255) not null, `order` integer not null, `component_type` varchar(255) not null, `component_id` integer not null, `article_id` integer not null, constraint `article_id_fk` foreign key(`article_id`) references "tmp_articles"(`id`) on delete CASCADE);
CREATE TABLE `posts` (`id` integer not null primary key autoincrement, `published_at` datetime null, `created_by` integer null, `updated_by` integer null, `created_at` datetime null default CURRENT_TIMESTAMP, `updated_at` datetime null default CURRENT_TIMESTAMP);
CREATE TABLE `homes_components` (`id` integer not null primary key autoincrement, `field` varchar(255) not null, `order` integer not null, `component_type` varchar(255) not null, `component_id` integer not null, `home_id` integer not null, constraint `home_id_fk` foreign key(`home_id`) references "tmp_homes"(`id`) on delete CASCADE);
CREATE TABLE `abouts_components` (`id` integer not null primary key autoincrement, `field` varchar(255) not null, `order` integer not null, `component_type` varchar(255) not null, `component_id` integer not null, `about_id` integer not null, constraint `about_id_fk` foreign key(`about_id`) references "tmp_abouts"(`id`) on delete CASCADE);
CREATE TABLE `abouts` (`id` integer not null primary key autoincrement, `title` varchar(255) null, `slug` varchar(255) null, `richtext_md` text null, `published_at` datetime null, `created_by` integer null, `updated_by` integer null, `created_at` datetime null default CURRENT_TIMESTAMP, `updated_at` datetime null default CURRENT_TIMESTAMP);
CREATE TABLE `homes` (`id` integer not null primary key autoincrement, `title` varchar(255) null, `slug` varchar(255) null, `richtext_md` text null, `published_at` datetime null, `created_by` integer null, `updated_by` integer null, `created_at` datetime null default CURRENT_TIMESTAMP, `updated_at` datetime null default CURRENT_TIMESTAMP);
CREATE TABLE `components_teaser_teaser_medias_components` (`id` integer not null primary key autoincrement, `field` varchar(255) not null, `order` integer not null, `component_type` varchar(255) not null, `component_id` integer not null, `components_teaser_teaser_media_id` integer not null, constraint `components_teaser_teaser_media_id_fk` foreign key(`components_teaser_teaser_media_id`) references "tmp_components_teaser_teaser_medias"(`id`) on delete CASCADE);
CREATE TABLE `components_teaser_teaser_texts_components` (`id` integer not null primary key autoincrement, `field` varchar(255) not null, `order` integer not null, `component_type` varchar(255) not null, `component_id` integer not null, `components_teaser_teaser_text_id` integer not null, constraint `components_teaser_teaser_text_id_fk` foreign key(`components_teaser_teaser_text_id`) references "tmp_components_teaser_teaser_texts"(`id`) on delete CASCADE);
CREATE TABLE `components_general_link_relations` (`id` integer not null primary key autoincrement, `Link_to_article` integer null, `Link_to_page` varchar(255) null);
CREATE TABLE `components_teaser_teaser_medias` (`id` integer not null primary key autoincrement, `Title` varchar(255) null, `Media_url` varchar(255) null, `Label` varchar(255) null, `Lead` varchar(255) null);
CREATE TABLE `components_teaser_teaser_texts` (`id` integer not null primary key autoincrement, `Title` varchar(255) null, `Lead` varchar(255) null, `Date` date null);
CREATE TABLE `articles` (`id` integer not null primary key autoincrement, `title` varchar(255) null, `lead` text null, `richtext_md` text null, `media_url` varchar(255) null, `slug` varchar(255), `author` integer null, `published_at` datetime null, `created_by` integer null, `updated_by` integer null, `created_at` datetime null default CURRENT_TIMESTAMP, `updated_at` datetime null default CURRENT_TIMESTAMP);
DELETE FROM sqlite_sequence;
CREATE UNIQUE INDEX `strapi_role_name_unique` on `strapi_role` (`name`);
CREATE UNIQUE INDEX `strapi_role_code_unique` on `strapi_role` (`code`);
CREATE UNIQUE INDEX `strapi_administrator_email_unique` on `strapi_administrator` (`email`);
CREATE UNIQUE INDEX `users-permissions_role_type_unique` on `users-permissions_role` (`type`);
CREATE UNIQUE INDEX `tokens_token_unique` on `tokens` (`token`);
CREATE UNIQUE INDEX `article_slug_unique` on `article` (`slug`);
CREATE UNIQUE INDEX `post_slug_unique` on `post` (`slug`);
CREATE UNIQUE INDEX `users-permissions_user_username_unique` on `users-permissions_user` (`username`);
CREATE UNIQUE INDEX `abouts_slug_unique` on `abouts` (`slug`);
CREATE UNIQUE INDEX `homes_slug_unique` on `homes` (`slug`);
CREATE UNIQUE INDEX `articles_slug_unique` on `articles` (`slug`);
COMMIT;
